import React from 'react';

import { Route, Link, BrowserRouter as Router } from 'react-router-dom'

const BackButton = ({ link }) => {
    return(
        <div>
            <div className="backbutton">
                <Link to={link} style={{ textDecoration: 'none' }}>
                    Back
                </Link>
            </div>
        </div>
    );
}

export default BackButton;
